function populateDistricts(stateid , districtid, VDCid = false){
	$('#'+stateid).change(function(){
		dist = $(this).val()
		if(!districtsList[dist]){
			// Decide What to do if district not found
		}
		else{
			// Generate district options
			options ="";
			$.each(districtsList[dist], function(key, value){
				options+="<option value='"+value+"'>"+value+"</option>";		
			});			
		

			$('#'+districtid).html(options);
			if(VDCid!=false){
				$("#"+districtid).change(function(){
					// Generate VDC options
					dist = $(this).val()
					options ="";
					$.each(VDCList[dist], function(key, value){
						options+="<option value='"+value+"'>"+value+"</option>";		
					});		
					$("#"+VDCid).html(options)	
				});
			}
			
		}	
		
	});
}
